import React from 'react';
import './skills.scss';

const Skills = () => (
    <div>
        <div className="skills-container">
            <div className="skills">
                <img src='https://i.postimg.cc/WbBMq5HM/icons8-amazon-web-services-96.png' alt="aws"></img>
                <img src='https://i.postimg.cc/YqG6S5br/icons8-nodejs-96.png' alt="node"></img>
                <img src='./aws.png' alt="react"></img>
                <img src='./aws.png' alt="vue"></img>
            </div>
        </div>
    </div>
);

export default Skills;
